import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import PrmNavBar from "./PrmNavBar";
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Button from 'react-bootstrap/Button';

class JiraScripts extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
        <div class="prm-background">
            <PrmNavBar></PrmNavBar>
            <div>
                <List >
                    <ListItem>
                        <Button href="http://localhost:3000/jirascripts/sw2_statistics" style={btnStyle}>Go</Button>
                        <ListItemText primary="ADCU Metrics" secondary="ADCU SW2 Weekly Metrics " />
                    </ListItem>

                    <ListItem>
                        <Button href="http://localhost:3000/jirascripts/create-analysis" style={btnStyle}>Go</Button>
                        <ListItemText primary="Analysis Stories for ADC420HA22" secondary="Create Analysis Stories for ADC420HA22 Epics in Classified" />
                    </ListItem>

                    <ListItem>
                        <Button href="http://localhost:3000/jirascripts/create-stories-and-subtasks" style={btnStyle}>Go</Button>
                        <ListItemText primary="Stories with subtasks" secondary="Create Stories with subtasks for ADC420HA22" />
                    </ListItem>

                    <ListItem>
                        <Button href="http://localhost:3000/jirascripts/clean-up" style={btnStyle}>Go</Button>
                        <ListItemText primary="Get issues which don't respect runtime transitions" secondary="Clean-up helper" />
                    </ListItem>

                    <ListItem>
                        <Button href="http://localhost:3000/jirascripts/walloffame" style={btnStyle}>Go</Button>
                        <ListItemText primary="See how many tickets respect the Unicorn workflow for each project" secondary="Wall Of Fame" />
                    </ListItem>
                    <ListItem>
                        <Button href="http://localhost:3000/jirascripts/script2" style={btnStyle}>Go</Button>
                        <ListItemText primary="Create epics in ADC420HA22" secondary="Create epics in ADC420HA22 based on epics in HGEN1L1" />
                    </ListItem>
                    <ListItem>

                        <Button href="http://localhost:3000/jirascripts/epicinanalyzed" style={btnStyle}>Go</Button>
                        <ListItemText primary="Make transition from analyzed to accepted" secondary="Epics from Analyzed to Accepted if it has a match issue in HGEN1L1 in Accepted" />

                    </ListItem>

                </List>
            </div>
      </div>
    );
  }
}

const btnStyle={
    margin:10,
}

export default JiraScripts;
